import React from 'react';
import { Navbar, Pastpaperbox } from '../components';
import 'flowbite';
import bio from '../assets/biology.avif'
import lit from '../assets/literature.jpeg'
import hist from '../assets/history.jpeg'
import phys from '../assets/physics.jpeg'
import rel from '../assets/religion.jpeg'
import eng from '../assets/english.png'
import chem from '../assets/chemistry.avif'
import com from '../assets/commerce.jpeg'
import geo from '../assets/geography.jpeg'
import math from '../assets/math.webp'
import acc from '../assets/accounting.jpeg'

const PastPapers = () => {
  return (
    <div className="w-full">
      <Navbar />
      <div className="flex flex-col w-[100%] px-[5%] items-center">
        <div className="mt-[5%] pb-10 font-extralight text-white xl:text-6xl">
          <p >View Past Papers</p>
        </div>

        <div className="flex items-center grid grid-cols-3 text-white font-poppins w-[100%]">

            {/* !!!!!!!!!!!  BIOLOGY  !!!!!!!!!!!!!!!*/}
            <div className="">
              <Pastpaperbox title_subj="2003" img_subj={bio}/>
            </div>

    <button id="dropdownDelayButton" data-dropdown-toggle="dropdownDelay" data-dropdown-delay="500" data-dropdown-trigger="hover" class="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center inline-flex items-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800" type="button">Dropdown hover <svg class="w-2.5 h-2.5 ml-2.5" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 10 6">
        <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m1 1 4 4 4-4"/>
      </svg>
    </button>


<div id="dropdownDelay" class="z-10 hidden bg-white divide-y divide-gray-100 rounded-lg shadow w-44 dark:bg-gray-700">
    <ul class="py-2 text-sm text-gray-700 dark:text-gray-200" aria-labelledby="dropdownDelayButton">
      <li>
        <a href="#" class="block px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-600 dark:hover:text-white">Dashboard</a>
      </li>
      <li>
        <a href="#" class="block px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-600 dark:hover:text-white">Settings</a>
      </li>
      <li>
        <a href="#" class="block px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-600 dark:hover:text-white">Earnings</a>
      </li>
      <li>
        <a href="#" class="block px-4 py-2 hover:bg-gray-100 dark:hover:bg-gray-600 dark:hover:text-white">Sign out</a>
      </li>
    </ul>
</div>


            {/* !!!!!!!!!!!  PHYSICS  !!!!!!!!!!!!!!!*/}
            <div className="">
              <Pastpaperbox title_subj="2004" img_subj={phys}/>
            </div>

            {/* !!!!!!!!!!!  History  !!!!!!!!!!!!!!!*/}
            <div className="">
              <Pastpaperbox title_subj="2005" img_subj={hist}/>
            </div>

            {/* !!!!!!!!!!!  CHEM  !!!!!!!!!!!!!!!*/}
            {/* <div className="">
              <Pastpaperbox title_subj="Chemistry" img_subj={chem}/>
            </div> */}

            {/* !!!!!!!!!!!  Literature  !!!!!!!!!!!!!!!*/}
            {/* <div className="">
              <Pastpaperbox title_subj="Literature" img_subj={lit}/>
            </div> */}

            {/* !!!!!!!!!!!  Religion  !!!!!!!!!!!!!!!*/}
            {/* <div className="">
              <Pastpaperbox title_subj="Religion" img_subj={rel}/>
            </div> */}

            {/* !!!!!!!!!!!  Commerce  !!!!!!!!!!!!!!!*/}
            {/* <div className="">
              <Pastpaperbox title_subj="Commerce" img_subj={com}/>
            </div> */}

            {/* !!!!!!!!!!!  Geography  !!!!!!!!!!!!!!!*/}
            {/* <div className="">
              <Pastpaperbox title_subj="Geography" img_subj={geo}/>
            </div> */}

            {/* !!!!!!!!!!!  English  !!!!!!!!!!!!!!!*/}
            {/* <div className="">
              <Pastpaperbox title_subj="English Language" img_subj={eng}/>
            </div> */}

            {/* !!!!!!!!!!!  Mathematics  !!!!!!!!!!!!!!!*/}
            {/* <div className="">
              <Pastpaperbox title_subj="Mathematics" img_subj={math}/>
            </div> */}

            {/* !!!!!!!!!!!  Bookkeeping & Accounts  !!!!!!!!!!!!!!!*/}
            {/* <div className="">
              <Pastpaperbox title_subj="Bookkeeping & Accounts" img_subj={acc}/>
            </div> */}

        </div>
        </div>
</div>
  );
};

export default PastPapers;
